import React, { useEffect } from 'react';
import logo from './logo.svg';
import './App.css';
import { GreetingGenerationRequest } from './proto/greeting_service_pb'
import { ImageServiceClient } from './proto/Greeting_serviceServiceClientPb'

function App() {
  useEffect(() => {

    (async () => {
      const client = new ImageServiceClient("http://localhost:8080");
      const req = new GreetingGenerationRequest()
      req.setImagePrompt("a sloth hanging on to a wire")
      req.setMessagePrompt("just hang in there")
      const resp = await client.generateGreeting(req, {}).catch(console.error)
      console.log(resp)
    })();
  }, [])
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
